import React from 'react'
import logo from '../assets/images/logo_lowRes.PNG';
import Button from '../components/Button';
import './header.css';

function Header(){
    return (
      <div className='header'>
        <img src={logo} className="logo" alt="logo" />
        <div className='topNav'>
          <div className='userAccess'>
            <Button text="User Register" textTransform="uppercase"></Button>
            <Button text="Administrator Log In" textTransform="uppercase"></Button>
          </div>
        </div>
        <div className='Pages'>
            <Button text="Home" textTransform="uppercase"></Button>
            <Button text="Test the Password" textTransform="uppercase"></Button>
            <Button text="Password Suggestions" textTransform="uppercase"></Button>
            <Button text="Contact Us" textTransform="uppercase"></Button>
          </div>

      </div>
    )
}



export default Header;
